            <h4>Rs.{price}</h4>
            <center><button style={{backgroundColor:'white', border:"0.2px solid black", width:200, height:30}}><img src="cartSymbol.jpeg" alt="cart" width={20} height={20}></img>Add to cart</button></center>
        </div>
    )

    
}
